import React, { useEffect } from "react";
import styled from "styled-components";
import logoName from "../assets/logo_name.png";
import { Avatar, Button } from "antd";
import { Link, useNavigate } from "react-router-dom";

const Wrapper = styled.div`
  height: 80px;
  width: 940px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 auto;
  padding: 0 32px 0 21px;
  .img {
    cursor: pointer;
  }
  .header-button {
    background-color: #0074dc;
    margin-right: 16px;
  }
  .header-button:hover {
    filter: brightness(1.1);
  }
`;

export default function Header() {
  let navigate = useNavigate();
  useEffect(() => {
    navigate("/home");
  });
  return (
    <div style={{ width: "100%" }}>
      <Wrapper>
        <Link to="/">
          <img src={logoName} style={{ height: "60px" }} className="img" />
        </Link>
        <div>
          <Button type="primary" shape="round" className="header-button">
            Etherum Mainnet
          </Button>
          <Avatar size={40} icon={<i className="fas fa-user"></i>} />
        </div>
      </Wrapper>
    </div>
  );
}
